I know there is no competition in my life, no one can outwork me, I can take the hits, no one else is limitless and fundamentally how many people are willing to die for what they believe in.

Music, Motivation have played their part, those of you who know my playlist, you will know it is full of songs that move me, audiobooks that educate me, motivation clips that inspire me and those â€œRockyâ€ clips that keep me fighting.

So today, I feel obliged to tell you to go â€œOne More Round.â€

